function Hobbies() {
    return (
        <div>
            <ul>
                <li>Cars</li>
                <li>Music</li>
                <li>Videogames</li>
                <li>Movies</li>
                <li>Swimming</li>
                <li>Photography</li>
                <li>Reading</li>
            </ul>
        </div>
    );
}

export default Hobbies;
